import React from 'react';
import styled from 'styled-components';
import { 
  motion,
  useTransform,
  useViewportScroll, 
} from "framer-motion"
import CarInfoDisplay from './CarInfoDisplay';

const StyledSlideTwo = styled.div`
  position: relative;
  background: #FFFFFF;
  height: 100vh;
  width: 100vw;
  position: sticky;
  scroll-snap-type: mandatory;
`;

function SlideTwo() {
  const { scrollYProgress } = useViewportScroll();
  const yRange = useTransform(scrollYProgress, [0, 0.5], [0, 1]);
  console.debug('yRange', yRange);
  // Add the text
  return (
    <StyledSlideTwo>
      <CarInfoDisplay />
    </StyledSlideTwo>
  );
}

export default SlideTwo;
